import React from "react";
import Button from "../UI/Button";
const MealsListItem = props => {
  return (
    <div>
      <div>
        {" "}
        <label>{props.menuItemName}</label>
        <p>{props.menuItemDetails}</p>
        <p>${props.price.float(2)}</p>
      </div>

      <div>
        <label>Amount </label> <input type="number" />
        <Button type>+ Add</Button>
      </div>
    </div>
  );
};

export default MealsListItem;
